export const ACTIONS = [
  { property: 'flex-direction', options: ['row', 'row-reverse', 'column', 'column-reverse'], default: 'row' },
  { property: 'flex-wrap', options: ['nowrap', 'wrap', 'wrap-reverse'] },
  { property: 'justify-content', options: ['flex-start', 'flex-end', 'center', 'space-between', 'space-around'] },
  { property: 'align-items', options: ['stretch', 'flex-start', 'flex-end', 'center', 'baseline'] },
  {
    property: 'align-content',
    options: ['stretch', 'flex-start', 'flex-end', 'center', 'space-between', 'space-around'],
  },
];
